	doc.addFont('Roboto-normal.ttf', 'Roboto', 'normal');

	doc.setFont('Roboto', 'normal');
	
	doc.addImage(imgData, 'PNG', 0, 0, 612, 792);
	
	var TextEntry8 = player.GetVar("TextEntry8");
	TextEntry8 = doc.splitTextToSize(TextEntry8, 530);
